contracts/project.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract CrowdFunding {

    string id;
    string name;
    string description;
    uint goal;
    uint funds;
    address payable author;
    string state;

    constructor(string memory _id, string memory _name, string memory _description, uint _goal) {
        id = _id;
        name = _name;
        description= _description;
        goal = _goal;
        author = payable(msg.sender); // La convertimos a tipo payable
        funds = 0;
        state = 'Opened';
    }

    function fundProject() public payable isNotAuthor {
        author.transfer(msg.value);
        funds += msg.value;
        emit fundProjectLog(id, msg.value);
    }

    function changeProjectState(string calldata newState) public isAuthor {
        state = newState;
        emit changeProjectStateLog(id, state);
    }

    modifier isAuthor() {
        require(msg.sender == author, 'Only author can change the state of the project');
        _;
    }

    modifier isNotAuthor() {
        require(msg.sender != author, 'The author cannot fund the project');
        _;
    }

    event fundProjectLog(string projectId, uint newFunds);

    event changeProjectStateLog(string projectId, string newState);
}

